VALUES ('3326120008267', '2 Crêpes de Froment Jambon Emmental à la Forestière', 'Crêpe (50%) : _Lait_ entier, farine de _blé_ (37%), _œuf_, huile de tournesol, sel, sucre. Garniture (50%) : Eau, emmental (_lait_) (14,3%), jambon (13,4%) (jambon de porc, eau, sel, arômes naturels, sirop de glucose, conservateurs : E316, E250), préparation aroomatisante (amidon de maïs modifié : E1422, sirop de glucose déshydraté, poudre de _lait_ écrémé, poudre de _lait_ entier, sel, hydrolysat de protéines végétales (_blé_), poudre de légumes, extraits de levures, arôme, légumes déshydratés), champignons forestiers réduits (8,5%) (_sulfites_) (bolets, cèpes, pholiotes, shiitakés, lactaires), crème fraîche (_lait_) (stabilisant : E407), amidon de tapioca, farine de _blé_, arômes naturels (_lactose, arômes naturels, sel), cèpes séchés (0,12%).', 'https://static.openfoodfacts.org/images/products/332/612/000/8267/front_fr.5.400.jpg', '8.8', '3.5', '20', '3.1', '', '8.6', '1.3', '0.511811023622047', '', '0');

