VALUES ('3329480016514', 'Farine 5 cereales et 3 graines', 'Mélange de farines* blé tendre T65*, seigle*, riz* , grand Épeautre millet décortiquée* , sésame blond* , flocons d\'avoine*, Gluten de issus de T\'agriculture biologique. Traces possibles de lupin et soja. A conserver dans un endroit frais sec et à l\'abri de la lumière, Informations nutritionnelles: Source de protélnes et de fibres, ce subtil mélange associant 5 céréales et 3 graines vous apportera tous les bienfaits de ces graines et céréales. Conseils d\'utilisations: La farine 5 céréales et 3 graines sera parfaite pour la conception de vos pains rustiques.Elle sera également idéale pour donner un goût authentique à vos différentes recettes : gâteauxt pâtes è tarte ou pizza, biscuits, galettes Conseils de préparation: Parfaitement adaptée aux recettes en machines à pains ou en méthode traditionnelle, en complément ou en remplacement de farines standards.', 'https://static.openfoodfacts.org/images/products/332/948/001/6514/front_fr.4.400.jpg', '4.2', '0.8', '63.2', '1.2', '6', '12.6', '0', '0', '', '1');

