VALUES ('3329485261124', 'Riz Rond Demi Complet D\'italie', 'Ingrédient : Riz rond biologique de qualité supérieure. sous atmosphère protectrice. Informations nutritionnelles : La teneur élevée en amidon contenue dans le riz lui confère des propriétés nutritives nécessaires pour l\'organisme. Le riz demi-complet est compromis entre le riz complet et blanc. Il a su préserver une partie du germe et de l\'enveloppe externe du grain (le son). Il fournit donc une quantité intéressante en nutriments. Conseils de préparation : Compter environ 60 g de riz par personne. Mettre le riz à cuire dans une casserole et couvrir largement d\'eau froide. Porter à ébullition et laisser cuire 25', 'https://static.openfoodfacts.org/images/products/332/948/526/1124/front_fr.4.400.jpg', '1.5', '0.2', '78', '0.1', '', '7.5', '0.01', '0.00393700787401575', '', '1');

